import React from 'react'
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
const year = new Date().getFullYear()
const Footer = () => {
    return (
        <footer>
           <Grid
         container
         direction="row"
         justifyContent="center"
         alignItems="center"
> 
       <Grid item>

           <p>Copyright {year} &copy; MIT</p> 
    </Grid> 
    </Grid> 
        </footer>
    )
}

export default Footer
